sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if(inputs.status == "200"){
  	var resp = inputs.response;
    var parsed = JSON.parse(resp);
    var hospitals = parsed["data"];
    hospitals.forEach(createHospital);
  } 

})(inputs, outputs);

function createHospital(item) {

  	var parsedItem = JSON.parse(JSON.stringify(item));
    var avail = new GlideRecord('x_598934_find_hosp_hospital');
  	avail.addQuery('name', parsedItem.Name);
  	avail.query();

  	if(avail.hasNext()){
      avail.next();
      avail.name = parsedItem.Name;
      avail.beds = parsedItem.beds;
      avail.population = parsedItem.population;
      avail.address = parsedItem.Address;
      avail.city = parsedItem.City;
      avail.state = parsedItem.State;
      avail.longitude = parsedItem.longitude;
      avail.latitude = parsedItem.latitude;
      avail.county = parsedItem.county;
      avail.update();

    } else {
      avail.initialize();
      avail.name = parsedItem.Name;
      avail.beds = parsedItem.beds;
      avail.population = parsedItem.population;
      avail.address = parsedItem.Address;
      avail.city = parsedItem.City;
      avail.state = parsedItem.State;
      avail.longitude = parsedItem.longitude;
      avail.latitude = parsedItem.latitude;
      avail.county = parsedItem.county;
      avail.insert();

    }

}

